	@Override
	public String addCity(CityModel cityModel) throws Exception {
		CityDomain cityDomain = new CityDomain();
		BeanUtils.copyProperties(cityModel, cityDomain);
		List<CityDomain> insertCityDomain = cityRepository.findAll();
		if (insertCityDomain.size() == 0) {
			String sql = insertCities();
			int res = jdbcTemplate.update(sql);
			if (res == 1) {
				System.out.println("success");
			} else {
				System.out.println("failure");
			}

		}
		return cityDAO.addCity(cityDomain);
	}

	@Override
	public List<CityDomain> getCityList() throws Exception {
		List<CityDomain> cityDomain = cityDAO.getCityList();
		return cityDomain;
	}

	@Override
	public CityDomain getCityListById(long cityId) throws Exception {
		CityDomain cityDomain = cityDAO.getCityListById(cityId);
		return cityDomain;
	}

	@Override
	public String updateCity(CityModel cityModel) throws Exception {
		CityDomain cityDomain = new CityDomain();
		BeanUtils.copyProperties(cityModel, cityDomain);
		return cityDAO.updateCity(cityDomain);

	}

	public String deleteCityById(long cityId) throws Exception {
		return cityDAO.deleteCityById(cityId);
	}

